const { render } = require("@testing-library/react");

function navBar() {
    const items = ["Home", "Education", "Experience", "Projects"];
    return (
        <div>
            <ul id = "nav" style={navCSS}>
                {items.map(item => (
                    <li style={navItemCSS} key={item}><a>{item.name}</a></li>
                ))}
            </ul>
        </div>
    )
}

const navCSS = {
    width: "100%",
    margin: "0 0 3px 0",
    display: "flex",
    flexDirection: "row"
}

const navItemCSS = {
    display: "block",
    margin: "10px",
    fontSize: "20px"
}

export default navBar;
